Acclaimed author Neil Gaiman and artist Andy Kubert joined forces to bring this unique, alternate-reality version of the Marvel Universe to life. Promotional info from Amazon - &quot;The year is 1602, and strange things are stirring in England. In the service of Queen Elizabeth, court magician Dr. Stephen Strange senses that the bizarre weather plaguing the skies above is not of natural origin. Her majesty's premier spy, Sir Nicholas Fury, fends off an assassination attempt on the Queen by winged warriors rumored to be in service to a mad despot named Doom. News is spreading of &quot;witchbreed&quot; sightings - young men bearing fantastic superhuman powers and abilities. And in the center of the rising chaos is Virginia Dare, a young girl newly arrived from the New World, guarded by a towering Indian warrior. Can Fury and his allies find a connection to these unusual happenings before the whole world ends?&quot;

These awesome new digital editions are by Zone-Empire. This is the first series only and NOT the sequels, with only have DCP editions so far. Thanks to Zone for their work, please seed and enjoy! :-)
